import { Icon } from "@iconify/react";

const links = [
  {
    id: 1,
    text: "repos",
    path: "/",
    icon: <Icon icon="octicon:repo-16" />,
  },
  {
    id: 2,
    text: "profile",
    path: "profile",
    icon: <Icon icon="icomoon-free:profile" />,
  },
];

export default links;
